import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-gray-800 p-4">
      <div className="container mx-auto flex justify-between">
        <Link to="/" className="text-white font-bold text-xl">Vehicle Sales</Link>
        <div className="space-x-4">
          <Link to="/" className="text-white hover:text-gray-300">Home</Link>
          <Link to="/user-panel" className="text-white hover:text-gray-300">User Panel</Link>
          <Link to="/vehicles" className="text-white hover:text-gray-300">Vehicles</Link>
          <Link to="/sold-vehicles" className="text-white hover:text-gray-300">Sold Vehicles</Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
